import './App.css';
import { Routes,Route } from 'react-router-dom';
import Admin from './Pages/Admin';
import Teacherlogin from './Pages/Teacherlogin';
import LoginPage from './Student_123/Pages/LoginPage'

function App() {

  <Routes>
    <Route path='/admin' element={<Admin/>}/>
  </Routes>

  return(

    localStorage.getItem('key') === '120'? <Admin /> :(choice===true)? <Teacherlogin />:<LoginPage/>
  );

}

export default App;
